    [],nt"revision_timestamp": "2015-05-06T22:36:10.498311",nt"name": "passive-wireless-saw-humidity-sensors-and-system-project",nt"isopen":
    true,nt"url": null,nt"notes": "Phase I demonstrated the technical feasibility
    of creating surface acoustic wave (SAW) based humidity sensors that respond rapidly
    (under 0.5 second) and reversibly to a wide range of humidity levels using nanoparticle
    and thin polymer films.  This proposal describes a Phase II effort that will result
    in the development of multiple uniquely identifiable, wirelessly interrogable, passive
    humidity sensors, and a wireless interrogation system to obtain and interpret the
    sensor responses.  The interrogation system used will be a slightly modified version
    of the system designed by ASR&amp;D for use in the wireless SAW concrete maturity
    monitoring system currently being developed by ASR&amp;D under funding from the
    Maryland Technology Development Corporation (TEDCO) and under the NASA Phase II
    STTR contract NNK07EA38C.  ASR&amp;D thinks that this interrogation system, which
    incorporates coded sensor time diversity with self-synchronization, has significant
    advantages over the OFC-sensor-based systems previously developed by the ASR&amp;D
    and the University of Central Florida in terms of increased range and the larger
    number of sensors that can simultaneously operate without sensor to sensor interference.
     The proposed Phase II effort has technical objectives that aim (i) to further
    the development and implementation of the passive wireless SAW humidity sensor technology
    for which preliminary technical feasibility was demonstrated in Phase I, (ii) to
    modify existing breadboard wireless interrogator electronics to operate with these
    sensors, and (iii) to produce prototype sensor devices capable of operation with
    the modified breadboard wireless interrogator system to produce a multiple sensor
    system usable for field demonstration of the technology.  Wireless system demonstrations
    will be conducted using laboratory samples of the composites used in wind turbines
    or other NASA relevant applications.  At the completion of the Phase II effort,
    the sensors and system will be at TRL 4-5.",nt"license_title": "U.S. Government
